import React from 'react'
import { useNavigate } from 'react-router-dom';
import {Route, Routes, ROutes} from 'react-router-dom';
import DetailedVideoContent from './Components/SubComponents/DetailedVideoContent';

// "file_name" : "",
/*
const redirectNewPage = () => {
  <Switch>
    <Route const path='/DetailedVideoContent'></Route>
  </Switch>
}
*/

const Video = (props) => {
    const navigate = useNavigate();
    const video_url  = props.video_url;

    const handleClick = () => {
      navigate("/DetailedVideoContent")
    }

    return (
      <div className="videoContent">
        <div className="videoUpperContent">
          <video width="558" height="290" controls>
            <source type="video/mp4" src={video_url}></source>
          </video>
        </div>

        <div className="videoLowerContent">
        <Routes>
        <Route path="/DetailedVideoContent" element={<DetailedVideoContent/>}></Route>
      </Routes>
          <button id='view-VideoDetails' onClick={handleClick.bind(this)}>View Details</button>  
        
        </div>  
      </div>
    )
}

export default Video

